function ResponseDisplay() {

  const navigate = useNavigate()

  // fetch data
  useEffect(() => {
    fetch("http://localhost:3500/questions/list")
      .then(res => res.json())
      .then(resJson => setList(resJson.data))
  }, [])

  return (
    <div>
      <button onClick={() => navigate(-1)}>Back</button>
      <StyledForm>
      </StyledForm>
    </div>
  )
}

export default ResponseDisplay
